import React from 'react'
import {Navbar, Nav} from 'react-bootstrap';

export default function NavigationBar() {
    return (
        <Navbar bg = "primary" variant="light" expand = "lg">
            <Navbar.Brand href = "#">
                VRide Carpooling
            </Navbar.Brand>
        </Navbar>
    )
}
